import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Auth from './auth/Auth';
import Notes from './pages/Notes';
import Create from './Components/pages/Create';
import { createMuiTheme, ThemeProvider } from '@material-ui/core';
import { purple } from '@mui/material/colors';
import { makeStyles } from '@material-ui/core';
import Sidebar from './Sidebar';
import Calendar from './Calendar'

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#fefefe'
    },
    secondary: purple
  },

  typography: {
    fontFamily: 'Quicksand',

    fontWightLight: 400,

    fontWightRegular: 500,

    fontWightMedium: 600,

    fontWightBold: 700
  },
});


const useStyles = makeStyles({
  page: 
  {
    background: '#f9f9f9',
    width: '100%' 
  },
  
  field: {
    marginTop: 20,
    marginBotton: 20,
    display: 'block'
  }
});



const MyRouter = () => 
{
  const classes = useStyles();


  return (
    <div>
      <ThemeProvider theme={theme} >
        <BrowserRouter>
          <Sidebar />
          <Routes>
                <Route path="/" element={<Auth/>} type="public"/>
                <Route path="/Create" element={<Create/>} type="private"/>
                <Route path="/Notes" element={<Notes/>} type="private"/>
                <Route path="/Calendar" element={<Calendar/>} type="private"/>
          </Routes>
        </BrowserRouter>
      </ThemeProvider>   

    </div>
  )
}

export default App;
